  <style>
    /* Basic Reset */
    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
    }

    body {
      background-color: #121212;
      color: white;
      font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
      display: flex;
      flex-direction: column;
      align-items: center;
      min-height: 100vh;
      padding: 20px;
    }
    
    header {
      text-align: center;
      margin-bottom: 30px;
      padding: 20px;
      background: rgba(255,255,255,0.1);
      border-radius: 10px;
      width: 100%;
      max-width: 1200px;
    }
    
    h1 {
      font-size: 2.5rem;
      margin-bottom: 10px;
      background: linear-gradient(90deg, #ff8a00, #e52e71);
      -webkit-background-clip: text;
      background-clip: text;
      color: transparent;
    }
    
    .gallery-grid {
      display: grid;
      grid-template-columns: repeat(auto-fill, minmax(250px, 1fr));
      gap: 20px;
      width: 100%;
      max-width: 1200px;
      margin: 0 auto;
    }
    
    .gallery-item {
      background: rgba(255,255,255,0.05);
      border-radius: 8px;
      overflow: hidden;
      transition: transform 0.3s ease;
    }
    
    .gallery-item:hover {
      transform: translateY(-5px);
    }
    
    .gallery-item img {
      width: 100%;
      height: 200px;
      object-fit: cover;
    }
    
    .gallery-item h2 {
      padding: 15px;
      font-size: 1.2rem;
    }
    
    footer {
      margin-top: 40px;
      text-align: center;
      width: 100%;
      padding: 20px;
    }
    
    footer a {
      color: #4fc3f7;
      text-decoration: none;
      transition: color 0.2s;
    }
    
    footer a:hover {
      color: #e91e63;
    }
  </style>
</head>
